/****** Object:  StoredProcedure [dbo].[sp_d_usuarioPermisoActualizacion]    Script Date: 23/11/2024 19:57:32 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[sp_d_usuarioPermisoActualizacion]
	@IdUsuario INT,
	@PuestoAnterior INT = null
AS
BEGIN
	if (@PuestoAnterior IS NOT NULL)
	BEGIN
		DELETE FROM UsuarioPermiso
		WHERE Id IN (
			SELECT up.Id
			FROM UsuarioPermiso up
			INNER JOIN FamiliaPatente fp ON fp.HijoId = up.PatenteId
			WHERE fp.PadreId = @PuestoAnterior AND up.UsuarioId = @IdUsuario)
	END
END
GO
